//index.js at client
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {Route, Redirect} from 'react-router'


ReactDOM.render(<App/>, document.getElementById('root'));

export default(
    <Route component={App} path="/">
        <Redirect from="*" to="" />
    </Route>
);
